import { useState, useEffect } from "react";

function Example() {
  const [name, setName] = useState("Prashant");

  useEffect(() => {
    document.title = `Hello ${name}`;
  }, [name]);

  return (
    <>
      <h1>{name}</h1>
      <button onClick={() => setName("Aayushi(")}>Change Name</button>
    </>
  );
}

export default Example;
